import re

def parse_input(input_string):
    """"""
    pattern = 'x - (-?\\d+\\.?\\d*(?:e[+-]?\\d+)?)\\s*,\\s*y - (-?\\d+\\.?\\d*(?:e[+-]?\\d+)?)'
    match = re.match(pattern, input_string)
    if match:
        x = float(match.group(1))
        y = float(match.group(2))
        return (x, y)
    else:
        return (None, None)
